import React from 'react'
import ListGroup from 'react-bootstrap/ListGroup'

export default function SearchResult(props) {
    let {searched}=props;
    let itemDisplay=searched.map(item=>{
        return (
            <li>{item}</li>
        )
    })
    return (
        <div>
        <ListGroup as="ul">
          <li>{itemDisplay}</li>
        </ListGroup>
    </div>
    )
}
